import React from "react";

export default function Product({ product }) {
  return (
    <div class="card" >
      <div class="card-body">
        <img class="card-img-top" src={product.img} alt="Card image cap" />
        <h5 class="card-title">{product.title}</h5>
        {/* <p class="card-text">{product.info}</p> */}
      </div>
    </div>
  );
}
